void test_scalar_operations_binary() {
  auto compare = [](auto l, auto r) {
    if constexpr (!std::is_arithmetic_v<decltype(l)>) {
      const auto l_s = l.val;
      if (std::isnan(r)) return std::isnan(l_s);
      if (std::isinf(r)) return std::isinf(l_s);
      double TOL = 1E-03;
      return std::abs(l_s - r) < TOL;
    } else {
      if (std::isnan(r)) return std::isnan(l);
      if (std::isinf(r)) return std::isinf(l);
      double TOL = 1E-03;
      return std::abs(l - r) < TOL;
    }
  };
}

